import React from "react";

function Education() {
  const educationMain = [
    {
      eDegree: "",
      eFrom: "",
      eDate: "",
      eContent: "",
    },
  ];

  return (
    <>
      <section className="sectionEducation">
        <div className="container w-50 h-50">
          <button
            type="button"
            class="btn btn-primary"
            data-bs-toggle="modal"
            data-bs-target="#exampleModal"
          >
            Launch demo modal
          </button>

          
        </div>
      </section>
    </>
  );
}

export default Education;
